function Home() {
  return (
    <div>
      <Navigation />
      <Grid container style={{marginTop:'100px'}}>
        <Grid item xs={12} sm={6}>
        <Typography variant='h4' style={{fontWeight:'bolder', wordSpacing:'10px', fontSize:'40px'}}> <span style={{color:'red'}}>DALBO CUNNO DHADHAN LEH</span>  <br /> <span>OO SI DHAQSA AHNA KU HEL DALABKAAGA</span> </Typography>
        </Grid>
      </Grid>
    </div>
  )
}

export default Home
